CREATE VIEW [dbo].[V_Info_Article]
AS
SELECT     dbo.ARTICLE.ART_ID AS [Article ID], dbo.ARTICLE.ART_DATEENT AS [Date Entre], dbo.ARTICLE.ART_PRIXUHT AS [Prix Unitaire], 
                      dbo.ARTICLE.ART_TAUXTVA AS [Taux TVA], dbo.ARTICLE.ART_DESCRIPTION AS Description, dbo.ARTICLE.ART_STOCKMIN AS [Stock Min], 
                      dbo.ARTICLE.ART_DATEPEREMTION AS [DATE PEREMTION], dbo.ARTICLE.ART_STOCKMAX AS [Stock Max], dbo.ARTICLE.ART_TYPE AS [Artcicle Type], 
                      dbo.ARTICLE.ART_STOCKABLE AS [Article Stokable], dbo.ARTICLE.ART_STOCKREEL AS [Article  Stock Reel], dbo.ARTICLE.ART_STOCKALERT AS [Article Stock Alert], 
                      dbo.ARTICLE.ART_STOCKRESERVE AS [Article Stock Reserve], dbo.ARTICLE.ART_CONOSOMABLE AS [Article Consomable], 
                      dbo.ARTICLE.ART_NATURE AS [Article  Nature], dbo.ARTICLE.ART_DATEMODIFICATION AS [Article Date Modification], 
                      dbo.ARTICLE.ART_MOTIFMODIFICATION AS [Article Motif Modification], dbo.ARTICLE.ART_PHOTOS AS Photos, dbo.CODE_BARE.CB_TYPE AS [Article Type], 
                      dbo.FAMILLE.FML_LIB AS [Famille ], dbo.MARQUE.MRQ_LIB AS Marque, dbo.RAYON.RAY_LIB AS Rayon, dbo.SOUS_FAMILLE.SF_LIB AS [Sous Famille], 
                      dbo.TVA.TVA_TAUX AS Tva, dbo.TARIF.TRF_LIBELE AS Tarif, dbo.TARIF.TRF_COEFFICIENT AS [Tarif  COEFFICIENT]
FROM         dbo.RAYON INNER JOIN
                      dbo.FAMILLE ON dbo.RAYON.RAY_ID = dbo.FAMILLE.RAY_ID INNER JOIN
                      dbo.SOUS_FAMILLE ON dbo.FAMILLE.FML_ID = dbo.SOUS_FAMILLE.FML_ID INNER JOIN
                      dbo.ARTICLE INNER JOIN
                      dbo.CODE_BARE ON dbo.ARTICLE.CB_ID = dbo.CODE_BARE.CB_ID INNER JOIN
                      dbo.MARQUE ON dbo.ARTICLE.MRQ_ID = dbo.MARQUE.MRQ_ID ON dbo.SOUS_FAMILLE.SF_ID = dbo.MARQUE.SF_ID INNER JOIN
                      dbo.TVA ON dbo.ARTICLE.TVA_ID = dbo.TVA.TVA_ID CROSS JOIN
                      dbo.TARIF

GO

GO
SET QUOTED_IDENTIFIER ON
GO
SET ANSI_NULLS ON
GO

CREATE VIEW [dbo].[V_Info_Articles]
AS
SELECT     dbo.ARTICLE.ART_PHOTOS AS Photos, dbo.ARTICLE.ART_ID AS [Article ID], dbo.ARTICLE.ART_DATEENT AS [Date Entre], 
                      dbo.ARTICLE.ART_PRIXUHT AS [Prix Unitaire], dbo.ARTICLE.ART_TAUXTVA AS [Taux TVA], dbo.ARTICLE.ART_DESCRIPTION AS Description, 
                      dbo.ARTICLE.ART_STOCKMIN AS [Stock Min], dbo.ARTICLE.ART_DATEPEREMTION AS [DATE PEREMTION], dbo.ARTICLE.ART_STOCKMAX AS [Stock Max], 
                      dbo.ARTICLE.ART_TYPE AS [Artcicle Type], dbo.ARTICLE.ART_STOCKABLE AS [Article Stokable], dbo.ARTICLE.ART_STOCKREEL AS [Article  Stock Reel], 
                      dbo.ARTICLE.ART_STOCKALERT AS [Article Stock Alert], dbo.ARTICLE.ART_STOCKRESERVE AS [Article Stock Reserve], 
                      dbo.ARTICLE.ART_CONOSOMABLE AS [Article Consomable], dbo.ARTICLE.ART_NATURE AS [Article  Nature], 
                      dbo.ARTICLE.ART_DATEMODIFICATION AS [Article Date Modification], dbo.ARTICLE.ART_MOTIFMODIFICATION AS [Article Motif Modification], 
                      dbo.MARQUE.MRQ_LIB AS Marque, dbo.RAYON.RAY_LIB AS Rayon, dbo.SOUS_FAMILLE.SF_LIB AS [Sous-Famille], dbo.FAMILLE.FML_LIB AS Famille
FROM         dbo.RAYON INNER JOIN
                      dbo.FAMILLE ON dbo.RAYON.RAY_ID = dbo.FAMILLE.RAY_ID INNER JOIN
                      dbo.SOUS_FAMILLE ON dbo.FAMILLE.FML_ID = dbo.SOUS_FAMILLE.FML_ID INNER JOIN
                      dbo.ARTICLE INNER JOIN
                      dbo.MARQUE ON dbo.ARTICLE.MRQ_ID = dbo.MARQUE.MRQ_ID ON dbo.SOUS_FAMILLE.SF_ID = dbo.MARQUE.SF_ID
